import React from "react";
import { Nav } from "../generalLayout/nav";
import { Helmet } from "react-helmet";
export default function BodyMotor(){
    return(
        <Nav />
    );
}
const namePage = "MV Motor";
class MyHome extends React.PureComponent {
  render() {
    return (
      <>
        <Helmet>
          <title>{namePage}</title>
        </Helmet>
      </>
    );
  }
}
